import React from "react"

import { ProductsBlock_v2, SearchHeader } from './index'

function AboutProducts({items}) {

  return (
    <div>
        {/*<SearchHeader name={items.name}/>*/}
      <div className="block-cards">
          {
            items.map((obj) => 
            <div>
              <ProductsBlock_v2 
              title={obj.category}
              data={obj.products}/>
            </div>)
          }
      </div>
    </div>
  )
}

export default AboutProducts
